import React, { Component } from 'react';

class YogaTable extends Component {
  render() {
    return (
      <div className="yoga-table">
        <table>
          <tr>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          </tr>
          <tr>
            <td>adfd</td>
          </tr>
        </table>
      </div>
    )
  }
}

export default YogaTable;
